    `
    https://jsonplaceholder.typicode.com/todos/${id}`,
    {},
    [num]
  );
  return (
    <div>
      <div>{num}</div>
      <button onClick={() => setNum((currentNum) => currentNum + 1)}>
        increment ID
      </button>
      <div>Loading: {loading.toString()}</div>
      <div>{JSON.stringify(error, null, 2)}</div>
      <div>{JSON.stringify(value, null, 2)}</div>
    </div>
  );
};

